const Profile = (props) => {
    const puppyStyles = {
        backgroundColor: 'lightGreen'
    }

    const imageStyles = {
    maxWidth: '150px',
    maxHeight: '150px'
}

    const {puppyName,puppyAddress,emailAddress,puppyImg} = props;
    console.log("puppyImg");
    return (
        <div style = {puppyStyles}>
            <h1>{puppyName}</h1>
            <p>{puppyAddress}</p>
            <p>{emailAddress}</p>
            <img style = {imageStyles} src = {puppyImg}></img>
        </div>

    )
}

export default Profile;


